import React, { Component } from 'react'
import { withRouter } from "react-router-dom";

 class Pages extends Component {
    constructor(props) {
        super(props);
        this.state = {
            url: "https://localhost/phprest/paltimapi.php",
            image: "../images/de.jpg",
            appcode:"",
            api: ""
        }
        this.callApi = this.callApi.bind(this);
    }
    componentDidMount() {
        this.callApi()
    }
    callApi() {
        let id = this.props.match.params.id;
        this.setState({appcode: id.slice(1,id.length)})
        fetch(this.state.url, {
            method: "POST",
            body: JSON.stringify({
              type: "id",
              id: id
            }),
            headers: {
              "Content-type": "application/json; charset=UTF-8",
            },
          })
            .then((res) => res.json())
            .then((res) => this.setState({ api: res }));
      }
    render() {
        return (
            <div>
                <iframe src="https://marianadascalitei.dev.ascensys.ro/paltimsalestool/api/appartmentPlans/1A3.12.pdf"  width="100%" height="1000px"/>
                <div>{this.state.appcode}</div>
            </div>
        )
    }
}
export default withRouter(Pages)
